            manufacturerDescription:
              - text: L'aspiration la plus puissante de tous les aspirateurs sans fil en
                  utilisation1. Il optimise intelligement le nettoyage et
                  l'autonomie. S'adapte au différents types de sols. Jusqu'à 60
                  minutes d'autonomie en mode Eco. Alimenté par le moteur Dyson
                  Hyperdymium™ Monte jusqu’à 125 000 tours/minute pour générer
                  l'aspiration la plus puissante de tous les aspirateurs en
                  utilisation.1 Caractéristiques Technologie Radial Root
                  Cyclone™ 14 cyclones génèrent des forces de plus de 79 000G
                  pour capturer les particules microscopiques sans obstruer le
                  filtre et sans perte d'aspiration. Système complet de
                  filtration Le système de filtration Dyson parfaitement étanche
                  capture 99,97% des particules aussi petites que 0,3 microns.
                  Rapport intelligent en temps réel Suit la performance 8000
                  fois par seconde, puis l’affiche en temps réel sur l’écran
                  LCD. Optimise intelligemment le nettoyage et l'autonomie En
                  mode Auto, le système de détection automatique (Dyson DLS™) de
                  la brosse High Torque contrôle la résistance de la brosse 360
                  fois par seconde, ajustant automatiquement la puissance aux
                  différents types de sols. Vous pouvez donc passer d'un tapis à
                  un sol dur sans avoir à changer de brosse. Mode Auto Il ajuste
                  automatiquement la puissance aux différents types de sols pour
                  optimiser l'autonomie. Mode Eco Jusqu'à 60 minutes
                  d'autonomie.2 Ideal pour les longues sessions de nettoyage sur
                  tous les types de sols. Mode Boost L'aspiration la plus
                  puissante de tous les aspirateurs sans fil en utilisation.1 Un
                  nettoyage partout La polyvalence de la technologie Dyson sans
                  fil facilite la nettoyage partout dans la maison. Avec des
                  accessoires Dyson adaptés à différentes tâches.
